import React from 'react';
import Head from 'next/head';
import Layout from '../components/Layout';

const Profile = () => {
  return (
    <>
      <Head>
        <title>Profile</title>
      </Head>
      <Layout>
        <div>Profile</div>
      </Layout>
    </>
  )
}

export default Profile;
